import React from 'react';
import '../style.css'
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    Redirect,
  } from "react-router-dom";
  import ProfileCard from './ProfileCard'
  import AdoptionItem from './AdoptionItem'
  import placeHolder from './images/dog.jpg'



class AdoptionScreen extends React.Component {

    render() {

        const pets = [<AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,
                       <AdoptionItem imgSrc={placeHolder} name="Dog" race="Beagle" age="6"/>,]

        return (
            <main id="profileHolder">
                <div class="perfilHolder">
                    <ProfileCard/>

                </div>
            </main>
        );
    }
}

export default AdoptionScreen;
